import './style.css';
import PhipsonSVG from './PhipsonSVG';
import { HashRouter } from 'react-router-dom';
import React from 'react';

import NavigationBar from './components/NavigationBar';

class App extends React.Component{
  render () {
    return (
      <HashRouter basename='/'>
        <div className="App">
          <NavigationBar />
        </div>
      </HashRouter>
    );
  }
}

export default App;
